        discription:
          "ಡಾ.ಬಿ.ರಮೇಶ್ ಬೆಂಗಳೂರಿನ ಶ್ರೀ ಜಯದೇವ ಇನ್ಸ್ಟಿಟ್ಯೂಟ್ ಆಫ್ ಕಾರ್ಡಿಯಾಲಜಿಯಲ್ಲಿ ಕಾರ್ಡಿಯಾಲಜಿ ಪ್ರಾಧ್ಯಾಪಕರಾಗಿದ್ದರು. ಅವರು 1987 ರಲ್ಲಿ ಡಿಎಂ ಕಾರ್ಡಿಯಾಲಜಿಯಲ್ಲಿ ರಿಜಿಸ್ಟ್ರಾರ್ ಆಗಿ ಸೇರಿಕೊಂಡರು, 1989 ರಲ್ಲಿ ಡಿಎಂ ಪೂರ್ಣಗೊಳಿಸಿದರು, 1990 ರಲ್ಲಿ ಸಹಾಯಕ ಪ್ರಾಧ್ಯಾಪಕರಾದರು, ಮತ್ತು 1995 ರಲ್ಲಿ ಪ್ರಾಧ್ಯಾಪಕರಾದ ಅವರು 2016 ರಲ್ಲಿ ನಿವೃತ್ತರಾದರು. ಅವರು ಭಾರತದಾದ್ಯಂತದ ಡಿಎಂ ಕಾರ್ಡಿಯಾಲಜಿ ಫೆಲೋಗಳಿಗೆ ತರಬೇತಿ ನೀಡುತ್ತಾರೆ. 29 ವರ್ಷಗಳಿಗಿಂತ ಹೆಚ್ಚು ಕಾಲದ ಅವರ ಸುದೀರ್ಘ ವೃತ್ತಿಜೀವನದಲ್ಲಿ ಸಾವಿರಾರು ಆಂಜಿಯೋಪ್ಲ್ಯಾಸ್ಟಿಗಳು, ಬಲೂನ್ ಮಿಟ್ರಲ್ ವಾಲ್ವುಲೋಪ್ಲ್ಯಾಸ್ಟೀಸ್, ಪೇಸ್‌ಮೇಕರ್ ಇಂಪ್ಲಾಂಟೇಶನ್‌ಗಳನ್ನು ಪ್ರದರ್ಶಿಸಿದ ಬೆಂಗಳೂರಿನ ಪ್ರವರ್ತಕ ಇಂಟರ್ವೆನ್ಷನಲ್ ಕಾರ್ಡಿಯಾಲಜಿಸ್ಟ್‌ಗಳಲ್ಲಿ ಒಬ್ಬರು. ಅವರು ಹೃದ್ರೋಗ ವಿಭಾಗದ ಪ್ರಾಧ್ಯಾಪಕರಾಗಿ ಮತ್ತು ಮುಖ್ಯಸ್ಥರಾಗಿ, ಡಿಎನ್‌ಬಿ ಕಾರ್ಡಿಯಾಲಜಿ ಕೋರ್ಸ್‌ನ ಸಂಯೋಜಕರಾಗಿ ಮತ್ತು ಬೆಂಗಳೂರಿನ ಬಿ.ಜಿ ರಸ್ತೆಯ ಅಪೊಲೊ ಆಸ್ಪತ್ರೆಯಲ್ಲಿ ಸಲಹೆಗಾರ ಹೃದ್ರೋಗ ತಜ್ಞರಾಗಿ ಸೇರಿದ್ದಾರೆ. ಹೃದಯ ಕಾಯಿಲೆಗಳ ರೋಗನಿರ್ಣಯ ಮತ್ತು ನಿರ್ವಹಣೆಗೆ ಅತ್ಯಾಧುನಿಕ ಸೌಲಭ್ಯಗಳೊಂದಿಗೆ 2011 ರಲ್ಲಿ ಅವರು ಬನಶಂಕರಿ 2 ನೇ ಹಂತದಲ್ಲಿ ತಮ್ಮದೇ ಆದ ರಮೇಶ್ ಕಾರ್ಡಿಯಾಲಜಿ ಕ್ಲಿನಿಕ್ ಅನ್ನು ಪ್ರಾರಂಭಿಸಿದ್ದಾರೆ.",
